import * as React from 'react';

const Index: React.FC = () => {
  // キーに関連するアクセス値
  const item_value = sessionStorage.getItem('item_key');
  // キーに値を割り当てる
  sessionStorage.setItem('item_key', item_value);

  return <div>HOME</div>;
};

export default Index;
